    <title>Guitar Notes</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            height: 100vh;
            margin: 0;
            background-image: url('guitar-theme.jpg'); /* Replace with the path to your guitar theme image */

            background-position: center;
            color: white; /* Adjust text color for better visibility */

        #frequencyInput {
            padding: 10px;
            font-size: 16px;
            margin-bottom: 10px;
            border: 1px solid #ccc;
            border-radius: 4px;
        }
        button {
            padding: 10px 20px;
            font-size: 16px;
            margin: 5px;
            border: none;
            border-radius: 4px;
            cursor: pointer;
            background-color: #007BFF;
            color: white;
        }
        button:hover {
            background-color: #0056b3;
        }
        #audioPlayer {
            margin-top: 20px;
        }
        #volumeControl {
            margin-top: 10px;
        }
        #currentFile {
            margin-top: 10px;
            font-size: 16px;
            color: white;
        }
    </style>
</head>

        let currentIndex = 0;

        function changeFrequency(change) {
            const input = document.getElementById('frequencyInput').value;
            const audioPlayer = document.getElementById('audioPlayer');
            const currentFileDisplay = document.getElementById('currentFile');
        
            // Filter files based on the input prefix
            const filteredFiles = availableFiles.filter(file => file.startsWith(input));
        
            if (filteredFiles.length === 0) {
                console.error('No files found for the given prefix');
                currentFileDisplay.textContent = 'Current file: None';
                return;
            }
        
            // Reset currentIndex if input changes
            if (change === 0) {
                currentIndex = 0;
            } else {
                currentIndex += change;
            }
        
            if (currentIndex < 0) currentIndex = 0;
            if (currentIndex >= filteredFiles.length) currentIndex = filteredFiles.length - 1;
        
            const newFilename = filteredFiles[currentIndex];
        
            console.log('Filtered files:', filteredFiles);
            console.log('Current index:', currentIndex);
            console.log('New filename:', newFilename);
        
            if (newFilename) {
                audioPlayer.src = `http://gitarre.tinbet.eu/${newFilename}`;
                audioPlayer.play();
                currentFileDisplay.textContent = `Current file: ${newFilename}`;
            } else {
                console.error('No valid filename found');
                currentFileDisplay.textContent = 'Current file: None';
            }
        }

        function togglePlayPause() {
            const audioPlayer = document.getElementById('audioPlayer');
            console.log('Audio player state:', audioPlayer.paused ? 'Paused' : 'Playing');
            if (audioPlayer.paused) {
                audioPlayer.play();
                console.log('Playing audio');
            } else {
                audioPlayer.pause();
                console.log('Pausing audio');
            }
        }

        function adjustVolume() {
            const audioPlayer = document.getElementById('audioPlayer');
            const volumeControl = document.getElementById('volumeControl');
            audioPlayer.volume = volumeControl.value;
        }
